import React, { useRef } from 'react';
import './BlogPosts.css';

function BlogPosts() {
  return (
    <Router>
      <div>
        <Routes>
          <Route path="/blog" element={<BlogPosts />} />
          <Route path="/" element={<About />} />
        </Routes>
      </div>
    </Router>
  );
}

export default BlogPosts;
